import React from "react";
import "./About.css";
import { Particles } from "react-particles-js";
import particleOpt from "./particles";
import itsEric from "./assets/img/EricChen.jpg"; //In React you need to Import photos to get it to render.
import Viasat from "./assets/img/Viasat.jpg";

function About() {
  return (
    <div>
      <div id="first-content">
        <div class="internal">
          <h1 class="whitner"> Professional</h1>
          <h3 class="gotthem">Viasat</h3>
          <p>
            Bootstrap jumbotron w/ particle.js to make the jumbo tron kinda
            transparent.
          </p>
        </div>
      </div>
      <div id="second-content">
        <div class="internal">
          <h1 class="johny">Skills</h1>
          <h3 class="cindy"> Uber</h3>
          <p>UBER AI Fuck them.</p>
        </div>
      </div>

      <Particles className="particles" params={particleOpt} />
    </div>
  );
}

export default About;
